      // setCourseCard(response.data.data.attributes.cards);
      setHeaderBottom(response.data.data.attributes.course.data.attributes.HeaderBottom);
      // setCourseCardContent(response.data.data.attributes.cards);
      // setFaq(response.data.data.attributes.FAQ);
      console.log(response.data.data,'Online Courses');
